import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { ResultResponse } from 'src/app/classes/resultResponse';
import { ResultService } from 'src/app/services/result.service';

@Component({
  selector: 'app-resultdetail',
  templateUrl: './resultdetail.component.html',
  styleUrls: ['./resultdetail.component.css']
})
export class ResultdetailComponent {

  resultResponse!:ResultResponse;

  constructor(private routes: ActivatedRoute,
              private resultService: ResultService ){

  }

ngOnInit(): void {

  this.loadResultDetail();
}

loadResultDetail(){
const urlId = this.routes.snapshot.paramMap.get('id');
const id = +urlId!;
this.resultService.getResultDetailList(id).subscribe((data)=>{
this.resultResponse = data;
console.log(this.resultResponse.resultResponse.content[0].result[0].lessonId);
})
}

}

<div class="quiz-result">
        <h1>MCQ Quiz Result</h1>
        <div class="question">
            <p class="question-text">1. What is the capital of France?</p>
            <ul class="options">
                <li class="option correct-option">A. Paris</li>
                <li class="option">B. Berlin</li>
                <li class="option">C. Madrid</li>
                <li class="option">D. London</li>
            </ul>
            <p class="user-answer correct-answer">Your Answer: A. Paris</p>
        </div>

        <div *ngFor="let item of resultResponse.resultResponse.result">
            {{item.lessonId}}
        </div>
</div>
